      </div>
      <div>
        <h1>Odabrane Usluge</h1>
        <p></p>
      </div>
      <div>
          <h1>Kontakt Podatci</h1>
          <p>Ime i prezime:</p>
          <p>Broj telefona:</p>
          <p>Email adresa:</p>
          <p>Napomena:</p>
      </div>
    </Fragment>
  );
}

export default SvePrikaz;
